import React, { useState } from 'react';

const Card = ({ ListData }) => {
    const [data, setData] = useState(ListData)
    console.log('data',data)
    const styles = {
        display: 'inline-block',
        width: '50%',
        height: '100px',
        border: '1px solid red'
    }
    const imageArea = {
        display: 'block',
        width: '100px',
        height: '100px',
        backgroundSize: '100px'
    }
    const fontStyle = {
        fontSize: 20,

    }

    const viewItem = () =>{
        return data.map((el, i) => {
            return(
                <div style={styles}>
                    <span style={{imageArea}}></span>
                    <span>{el.brandName}</span>
                    <span>{el.content}</span>
                    <span>{el.majorCategoryName}</span>
                </div>
            )
        })
    }

    return(
       <>
            {viewItem()}
       </>   
    );
}

export default Card;
